import React from "react";
import * as myProjectService from "../services/myProjectService";

import { Card, CardBody, CardFooter, Row, Col } from "reactstrap";

import CardAuthor from "components/CardElements/CardAuthor.jsx";
// import FormInputs from "components/FormInputs/FormInputs.jsx";
import Button from "components/CustomButton/CustomButton.jsx";

import damirBosnjak from "assets/img/damir-bosnjak.jpg";
// import Register from "components/Register";

class Articles extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      articles: []
    };
  }

  //   componentDidMount() {
  //     console.log("mounted");
  //     myProjectService
  //       .getAllProfiles()
  //       .then(this.onGetAllSuccess)
  //       .catch(this.onError);
  //   }

  //   onGetAllSuccess = response => {
  //     console.log("successful get all profiles");
  //     // debugger;
  //     this.setState({
  //       myProject: response.data.items
  //     });

  //     console.log(response.data.items);
  //   };

  //   onError = () => {
  //     console.log("get all profiles error");
  //   };

  // onSubmit = e => {
  //   e.preventDefault();
  //   // console.log(values);
  //   debugger;
  //   const payload = this.props.data;
  //   console.log(payload);
  //   myProjectService
  //     .submitProfile(payload)
  //     .then(this.onSuccess)
  //     .catch(this.onError);
  // };

  // onSuccess = () => {
  //   console.log("successful ya");
  //   // console.log(this.props.match.params.id);
  // };

  // onError = () => {
  //   console.log("boo boo");
  // };
  componentDidMount() {
    debugger;
    // console.log(this.props.data);

    myProjectService
      .getHoroscopes()
      .then(this.onSuccess)
      .catch(this.onError);
  }

  onSuccess = resp => {
    console.log("successs get horoscopes");
    console.log(resp.data.items);
    this.setState({
      horoscopes: resp.data.items
    });
    // console.log(this.state.horoscopes[2]);
  };

  onError = () => {
    console.log("Error on horoscopes");
  };

  mapScraper = astro => {
    // let astro = this.state.horoscopes;
    console.log("astro", astro);
    return (
      <React.Fragment>
        <Col lg={12}>
          <div className="mr-auto   text-center">
            <img src={astro.image} alt="..." />
          </div>
          <div className="mr-auto   text-center"> {astro.name} </div>
          <div className="mr-auto   text-center"> {astro.date}</div>
        </Col>
      </React.Fragment>
    );
  };

  render() {
    return (
      <React.Fragment>
        <div className="content">
          <Row>
            {/* <React.Fragment key={yoga.id}> */}
            {/* <div className="content"> */}
            {/* <Row> */}
            <Col md={12}>
              <Card className="card-user">
                <div className="image">
                  <img src={damirBosnjak} alt="..." />
                </div>
                <CardBody>
                  <CardAuthor
                    avatar={this.props.data.image}
                    avatarAlt="..."
                    // title={
                    //   this.
                    // }
                  />
                  <p className="description text-center">
                    {" "}
                    Certifications: {this.props.data.certifications}
                  </p>
                  <p className="description text-center">
                    {" "}
                    Specializations: {this.props.data.specializations}
                  </p>
                  <p className="description text-center">
                    {" "}
                    Yoga Style: {this.props.data.yogaStyle}
                  </p>
                  <p className="description text-center">
                    {" "}
                    Rates: {this.props.data.rates}
                  </p>
                  <p className="description text-center">
                    {" "}
                    Location: {this.props.data.location}
                  </p>

                  <p className="description text-center">
                    Bio: {this.props.data.bio}
                  </p>
                </CardBody>

                <CardFooter>
                  <Row>
                    <div onClick={this.onSubmit} className=" ml-auto mr-auto">
                      <Button size="sm" color="primary">
                        Confirm
                      </Button>
                    </div>
                    <div
                      //    onClick={this.onSubmit}
                      className=" ml-auto mr-auto"
                    >
                      <Button size="sm" color="success">
                        Update
                      </Button>
                    </div>
                    <div
                      //    onClick={this.onSubmit}
                      className=" ml-auto mr-auto"
                    >
                      <Button size="sm" color="danger">
                        Delete
                      </Button>
                    </div>
                  </Row>

                  {/* <Row>
                    <div
                      //    onClick={this.onSubmit}
                      className="update ml-auto mr-auto"
                    >
                      <Button color="primary" round>
                        Update
                      </Button>
                    </div>
                  </Row> */}
                </CardFooter>
              </Card>
            </Col>{" "}
          </Row>
        </div>
      </React.Fragment>
    );
  }
}

export default Articles;
